import React, { Component } from 'react';
import axios from 'axios';
import './App.css';

const url_users = 'http://localhost:3001/users';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      address: ''
    };
  }
  componentDidMount() {
    axios
      .get(url_users)
      .then(response => (this.info = response));
  }

  render() {
    return (
      <div className="app">
        <h1 className="app-title">ユーザ</h1>
        <p> 名前: {this.info} </p>
      </div>
    );
  }
}

export default App;
